import React,{Fragment, useEffect, useState} from 'react';

const Dashboard = ({setAuth})=>{
    const [username, setUsername] = useState('');
    const GetDetails = async ()=>{
        try {
            const query = await fetch('http://localhost:5000/dashboard',{
                method: 'GET',
                headers : {token : localStorage.token}
            })
            const response = await query.json();
            console.log(response);
            setUsername(response.username);
        } catch (error) {
            console.log(error.message);
        }
    };
    useEffect(()=>{
        GetDetails();
    },[])
    return(
<Fragment>
<nav className="navbar navbar-expand-lg navbar-light bg-light">
  <a className="navbar-brand" href='http://localhost:3000/dashboard'>Home</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>

  <div class="collapse navbar-collapse" id="navbarSupportedContent">
  <form class="form-inline my-2 my-lg-0"  style={{display : 'flex', justifyContent : 'flex-end', width : '100%', padding : '0px'}}>
      <h3>Welcome {username}</h3>
      <button class="btn btn-outline-danger my-2 my-sm-0"  type="submit" onClick={()=>setAuth(false)}>Logout</button>
    </form>
  </div>
</nav>
</Fragment>
    );
};

export default Dashboard;
